    false,nt"url": null,nt"notes": "This annual narrative report for Supawna
    Meadows National Wildlife Refuge outlines Refuge accomplishments during the 1997
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses management planning and compliance with environmental and cultural
    resource mandates. Refuge administration is outlined; information about personnel,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, grasslands, fire
    management, and pest control. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, animal control, and marking and bird banding.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    and computer systems. Items of interest are provided at the end.",nt"owner_org":
